// SPDX-License-Identifier: MIT

pragma solidity 0.7.4;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts-upgradeable/proxy/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/math/MathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/math/SafeMathUpgradeable.sol";
import "./DistributorRegistry.sol";
import "./IDistributor.sol";


contract Distributors is
    Initializable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable
{
    using MathUpgradeable for uint256;
    using SafeMathUpgradeable for uint256;

    DistributorRegistry public registry;
    uint public _ownersCoverCount;

    bytes4 public constant IID_IERC165 = type(IDistributor).interfaceId;

    event BoughtCover(
        bytes32 indexed provider,
        IDistributor.Cover
        );

    event ErrorNotHandled(
        address indexed owner,
        bytes distributor,
        bytes reason
    );

    function initialize(
            address payable _registry
        ) public initializer {
        __Ownable_init();
        __ReentrancyGuard_init();
            registry = DistributorRegistry(_registry);
    }

    function getDistAddress(string memory _distributorName) public view returns(address){
        return registry.distributors(_distributorName);
    }

    function getCoversCount( string memory _distributorName, address _owner, bool _isActive) public view returns(uint256){
             IDistributor distributor = IDistributor(registry.distributors(_distributorName));
              uint256 _ownersCoverCount = distributor.getCoverCount(_owner,_isActive);
              return _ownersCoverCount;
    }



    function getCovers(
        string memory _distributorName,
        address _owner,
        bool _isActive,
        uint256 _limitLoop
    ) external view returns (IDistributor.Cover[] memory covers) {
      IDistributor distributor = IDistributor(registry.distributors(_distributorName));
      uint256 _ownersCoverCount = distributor.getCoverCount(_owner,_isActive);

        uint256 limit = 0;
            if(_ownersCoverCount > _limitLoop){
                limit = _limitLoop;
            }else{
                limit = _ownersCoverCount;
            }

        IDistributor.Cover[] memory userCovers = new IDistributor.Cover[](limit);

        for(uint _coverId = 0; _coverId < limit ; _coverId++){
            IDistributor.Cover memory cover = distributor.getCover(_owner,_coverId,_isActive,_limitLoop); 
            userCovers[_coverId] = cover;
        }
        return userCovers;
    }


    function getQuote(
        string memory _distributorName,
        uint256 _interfaceCompliant1,
        uint256 _interfaceCompliant2,
        uint256 _sumAssured,
        uint256 _coverPeriod,
        address _contractAddress,
        address _coverAsset,
        address _nexusCoverable,
        bytes calldata _data
    )external view returns(
        IDistributor.CoverQuote memory
    ){
         IDistributor distributor = IDistributor(registry.distributors(_distributorName));

         return distributor.getQuote( _interfaceCompliant1,
                                _interfaceCompliant2,
                                _sumAssured,
                                _coverPeriod,
                                _contractAddress,
                                _coverAsset,
                                _nexusCoverable,
                                _data);
    }

    function buyCover(
        string memory _distributorName,
        address contractAddress,
        address coverAsset,
        uint256 sumAssured,
        uint16 coverPeriod,
        uint8 coverType,
        uint256 maxPriceWithFee,
        bytes calldata data
    ) external payable {
        IDistributor distributor = IDistributor(registry.distributors(_distributorName));
        distributor.buyCover(contractAddress,
                                  coverAsset,
                                  sumAssured,
                                  (coverPeriod),
                                  (coverType),
                                  maxPriceWithFee,
                                  data);
    }

    function buyCoverDecode(
        string memory _distributorName,
        uint16[] memory products,
        uint16[] memory durationInDays,
        uint256[] memory amounts,
        address currency,
        uint256 premiumAmount,
        uint256[] memory helperParameters,
        uint256[] memory securityParameters,
        uint8[] memory v,
        bytes32[] memory r,
        bytes32[] memory s
    ) external payable{
         IDistributor distributor = IDistributor(registry.distributors(_distributorName));
         distributor.buyCoverDecode(products,
                                  durationInDays,
                                  amounts,
                                  currency,
                                  premiumAmount,
                                  helperParameters,
                                  securityParameters,
                                  v,
                                  r,
                                  s);
    }

    fallback() external payable {
        revert("Function does not exist");
    }

}
